import React, { Component } from 'react';
import axios from 'axios';


export default class Devis extends Component {
    constructor(props) {
        super(props);
        this.state = {
            client: [],
        }
    }

    componentDidMount() {

        axios.get(`https://sayse.pipedrive.com/v1/deals?api_token=d168467b213a71acdc4ba5cb5b2cfe96529ac061`)
        .then(res => {
            var yenyen = [];

                res.data.data.forEach(element => {
                    yenyen.push(element.person_name)
                });

                this.setState({client: yenyen})

            });
    }

    render() {
        // console.log(this.state.client)

        return (
            <div className="container">
            <div className='row'>
            <div className="col-2">
            <ul>
              {
            this.state.client.map(function(item, i){
                // console.log(item);
                if(item !== null){
                return <li key={i}>{item}</li>;
                }else{
                    console.log(null)
                }
            })
             }
            </ul>
          </div>
          </div>
          </div>
        )
    }
}
